//UsrName: zapatahall1 pasword: tAma...#1055
import React, { useState } from 'react';
import './styles2.css';
import { Link } from 'react-router-dom';
import axios from 'axios'; // Import Axios for making HTTP requests


// Import both logo images
import logo from './squarechesslogolong.png'; // Adjust the path as needed
import logoWhite from './squarechesslogolongwhite.png'; // Adjust the path as needed

const LandingPage = () => {
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');
    const [isLogoHovered, setIsLogoHovered] = useState(false);

    const handleUsernameChange = (e) => {
        setUsername(e.target.value);
    };


    const handlePasswordChange = (e) => {
        setPassword(e.target.value);
    };

    const handleLogin = async () => {
        try {
            const response = await axios.post('http://localhost:3001/api/auth/login', { username, password });
            console.log(response.data); // Handle successful login response
        } catch (error) {
            if (error.response) {
                // The request was made and the server responded with a status code
                // that falls out of the range of 2xx
                console.error(error.response.data);
            } else if (error.request) {
                // The request was made but no response was received
                // `error.request` is an instance of XMLHttpRequest in the browser and an instance of
                // http.ClientRequest in node.js
                console.error(error.request);
            } else {
                // Something happened in setting up the request that triggered an Error
                console.error('Error', error.message);
            }
        }
    };


    return (
        <div className="landing-page">
            <header>
        <nav>
            <ul>
                <li><a href="#"><img src="logo.png" alt="SquareChess Logo" class="logo"></img></a></li>
                <li><a href="#">Blunder Punisher</a></li>
                <li><a href="#">Weakness Finder</a></li>
                <li><a href="#">Analysis Board</a></li>
                <li><a href="#">About Us</a></li>
                <li><a href="#" class="login-button">Log In</a></li>
            </ul>
        </nav>
    </header>
    <main>
        <section class="hero">
            <h1>Master Your Chess with Superior Preparation</h1>
            <button>Get Started</button>
        </section>
        <section class="login-section">
            <form class="login-form">
                <input type="text" placeholder="Username"/>
                <input type="password" placeholder="Password"/>
                <button class="login-button">Log In</button>
                <div class="create-account-div">
                    <p>Don't have an account?</p>
                    <a href="/signup" class="create-account-button">Create a SquareChess Account</a>
                </div>
            </form>
        </section>
    </main>
    <footer>
        <p>&copy; 2024 SquareChess.org All rights reserved.</p>
    </footer>
        </div>
    );
};

export default LandingPage;
